  false,\n\t\"url\": null,\n\t\"notes\": \"Areas to be rehabilitated have been selected
  for traditional winter moose range along the Glen Highway on Fort Richardson. We
  use a field reconnaissance to determine suitable areas which will be rehabilitated.
  Selected areas are those which are composed of the most important browse species,
  willow and birch, and areas where there is overgrown vegetation. Prepared for the
  Alaska Interagency Moose Committee Meeting, Seward, Alaska, 5 May 1977.\",\n\t\"license_title\":
